import './App.css';
import { Route, HashRouter} from "react-router-dom"; 
import { Header, Footer, Loading } from './component';
import Home from './pages/home';
import Final_Project from './pages/Final-Project';

const App = () => {
  return (
    <HashRouter>
      <div className="App">
        <div>
          <Header />
        </div>
        <div className="content">
          <Route exact path="/" component={Home}></Route>
          <Route path="/final_project" component={Final_Project}></Route>
        </div>
        <div>
          <Footer />
        </div>
      </div>
    </HashRouter>
  );
}

export default App;
